import React from 'react';

const Profile = ({ name, email, age }) => {
  return (
    <div style={{ backgroundColor: 'lightgray', padding: '10px' }}>
      <h1>Profile Information</h1>
      <p>First Name: {name}</p>
      <p>Last Name: {name}</p>
      <p>Email: {email}</p>
    </div>
  );
};

export default Profile;
